import React from 'react'
import BOY from "../src/boy.png"
export default function FleetsDignin() {
    return (
        <div>
            <div>
            <img src={BOY} className="img-fluid" alt="Responsive image"/>
            </div>
            <h4>Fleets Signup</h4>
        </div>
    )
}
